import React from 'react';
import Uniforme from '../Distributions/Uniforme';
import BreadcrumbItem from 'antd/lib/breadcrumb/BreadcrumbItem';
import Breadcrumb from 'antd/lib/breadcrumb';

const Body = () => {
    return(
      <div style={{background:"#fff", padding:25, minHeight:500}}>
      <Breadcrumb>
        <BreadcrumbItem>
          <Distribution name={"Uniforme Continua"} funcion={(x)=>x*x} />
        </BreadcrumbItem>
      </Breadcrumb>
      </div>
    )
}

export default Body
